pragma solidity ^0.8.0;

contract LocalVariable {
    uint public i;
    bool public b;
    address public myAddress;

    function foo() external{
        // These variables will be gone after fn finishes excecution
        uint x = 123;
        bool f =false;
        x += 456;
        f = true;
        
